window.bookSummaryJSON = "<p>We tend to take it for granted, but the way we breathe influences our entire life experience. So, if we want something to change, our breath is the place to start. On <i>Freeing the Breath</i>, Leslie Kaminoff shares the wisdom of 30 years of teaching to liberate us from dysfunctional breathing patterns and open us to new levels of health and well-being.</p>"; 
